import RoomWithTribalArt from "../assets/mobile/image-grid-1.jpg";

function YourDayAtTheGallery() {
  return (
    <div className="YourDayAtTheGallery container">
      <img src={RoomWithTribalArt} alt="RoomWithTribalArt"></img>
      <h2>YOUR DAY AT THE GALLERY</h2>
      <p>
        Wander through our distinct collections and find new insights about our
        artists. Dive into the details of their creative process.
      </p>
    </div>
  );
}

export default YourDayAtTheGallery;
